INSERT INTO `article` VALUES (1,1,'Un nouveau President en afrique du sud','Nouveau depart pour ce pays a l\'histoire tragique',NULL,'Au pouvoir depuis 30 ans, a perdu sa majorité absolue lors des élections législatives. Un nouveau parti politique, le uMkhonto we Sizwe (abrégé en MK), est apparu sur la scène politique. La nouvelle Assemblée est chargée d’élire le nouveau président au cours du mois de juin. Cyril Ramaphosa, actuel chef du parti ANC, est confronté à ce revers historique. L’article explore les implications de ce changement politique majeur.\n\nL’expression “nouveau départ” prend ici une signification profonde compte tenu de l’histoire tumultueuse de l’Afrique du Sud. Le pays a connu des moments tragiques, notamment l’attentat de l’Association mutuelle israélite argentine (AMIA) en 1994, qui a fait 85 morts et 230 blessés. Ce drame marque à jamais la nation.','2024-06-05 08:09:16',NULL,NULL,0,12,'PUBLIER',NULL,'Mr Tetcha Lu',NULL,NULL,NULL,NULL,'pD5ky59qQ'),(2,1,'Le Niger accuse le Bénin de \'kidnapper\' cinq de ses ressortissants','Tensions diplomatiques suite à un incident à la frontière',NULL,'Le régime militaire nigérien a accusé le Bénin d\'avoir \'kidnappé\' cinq de ses ressortissants qui étaient en mission dans ce pays voisin pour contrôler le flux de produits pétroliers. Cet incident a provoqué des tensions diplomatiques entre les deux pays, et les autorités nigériennes ont appelé à la libération immédiate de leurs ressortissants.','2024-06-11 14:47:30',NULL,'2024-06-17 02:04:19',0,1,'SUSPENDU',NULL,'Steve celestin',NULL,NULL,NULL,NULL,'JTT4o9oxP'),(3,1,'Soudan : plus de 10 millions de déplacés internes, selon l\'ONU','Une crise humanitaire croissante dans un pays en transition',NULL,'L\'ONU a averti que le nombre de personnes déplacées au Soudan a dépassé les 10 millions, soit environ un quart de la population du pays. Cette crise humanitaire croissante est aggravée par le conflit en cours, la pauvreté et les bouleversements politiques. L\'ONU a appelé à un soutien international urgent pour répondre aux besoins des populations touchées.','2024-06-11 14:48:32',NULL,NULL,0,1,'EN_ATTENTE',NULL,'Mr Tetcha Lu',NULL,NULL,NULL,NULL,'x4pXfCip'),(4,1,'Burkina Faso : en tête des 10 crises de déplacement de populations \'les plus négligées\' au monde','Manque d\'attention et d\'aide pour les populations déplacées',NULL,'Selon un rapport de l\'organisation non gouvernementale Internal Displacement Monitoring Centre (IDMC), le Burkina Faso est en tête des 10 crises de déplacement de populations \'les plus négligées\' au monde. Le rapport souligne le manque d\'attention et d\'aide internationale pour les personnes déplacées au Burkina Faso, qui sont confrontées à des conditions de vie extrêmement difficiles.','2024-06-11 14:49:23',NULL,NULL,0,1,'EN_ATTENTE',NULL,'Mr Tetcha Lu',NULL,NULL,NULL,NULL,'gRXhLAcD'),(5,1,'L\'intelligence artificielle refaçonne l\'économie africaine','Une nouvelle ère pour l\'innovation et la croissance',NULL,'L\'intelligence artificielle (IA) est en train de transformer les économies africaines, en stimulant l\'innovation, la croissance et la création d\'emplois. De nombreux pays africains investissent dans des initiatives d\'IA pour améliorer les services publics, l\'agriculture, la santé et d\'autres secteurs clés. L\'IA offre un immense potentiel pour relever les défis du continent et stimuler son développement socio-économique.','2024-06-11 14:50:15',NULL,NULL,0,1,'EN_ATTENTE',NULL,'Mr Tetcha Lu',NULL,NULL,NULL,NULL,'1FhF5CS'),(6,1,'La BAD définit sa stratégie pour stimuler l\'économie africaine','Focus sur la croissance inclusive, la résilience et la création d\'emplois',NULL,'La Banque africaine de développement (BAD) a dévoilé sa nouvelle stratégie pour les cinq prochaines années, visant à stimuler une croissance économique inclusive et résiliente en Afrique. La stratégie met l\'accent sur la création d\'emplois, l\'industrialisation, l\'intégration régionale et la transition vers une énergie verte. La BAD prévoit d\'investir 300 milliards de dollars sur la période pour soutenir la mise en œuvre de cette stratégie.','2024-06-11 14:51:26',NULL,NULL,0,1,'EN_ATTENTE',NULL,'Eloundou jean chirac',NULL,NULL,NULL,NULL,'ZERdYkqJ'),(7,1,'Nigeria : manifestations contre l\'augmentation du prix de l\'électricité','Colère populaire face à la crise énergétique',NULL,'Des manifestations ont éclaté au Nigeria pour protester contre la hausse des prix de l\'électricité, qui a aggravé les difficultés économiques des ménages. Le gouvernement a justifié cette augmentation par la nécessité de réduire les subventions et d\'améliorer la viabilité du secteur de l\'énergie. Cependant, les citoyens dénoncent le manque de services publics fiables et la dégradation des infrastructures.','2024-06-11 14:52:06',NULL,NULL,0,1,'EN_ATTENTE',NULL,'Eloundou jean chirac',NULL,NULL,NULL,NULL,'N2f51RpBT'),(8,1,'Afrique du Sud : le vol d\'électricité devient une question de \'survie\' pour certains','Crise énergétique et impact sur les populations',NULL,'Afrique du Sud : le vol d\'électricité devient une question de \'survie\' pour certains,Afrique du Sud : le vol d\'électricité devient une question de \'survie\' pour certainsAfrique du Sud : le vol d\'électricité devient une question de \'survie\' pour certains\n\nAfrique du Sud : le vol d\'électricité devient une question de \'survie\' pour certainsAfrique du Sud : le vol d\'électricité devient une question de \'survie\' pour certains\n\nAfrique du Sud : le vol d\'électricité devient une question de \'survie\' pour certainsAfrique du Sud : le vol d\'électricité devient une question de \'survie\' pour certains\n','2024-06-11 14:56:57',NULL,NULL,0,1,'EN_ATTENTE',NULL,'Steve celestin',NULL,NULL,NULL,NULL,'fyPpw0C7'),(9,3,'L\'entrepreneuriat au Cameroun : Un moteur de croissance et de développement','Dynamisme et potentiel d\'une jeunesse entreprenante',NULL,'L\'entrepreneuriat joue un rôle crucial dans la croissance économique et le développement du Cameroun. De nombreux jeunes Camerounais se lancent dans la création d\'entreprises, innovant et apportant des solutions concrètes aux problèmes du pays. Le gouvernement camerounais met également en place des politiques et des initiatives pour soutenir et encourager l\'entrepreneuriat.','2024-06-11 14:59:32',NULL,'2024-06-17 01:56:21',0,3,'PUBLIER',NULL,'Eloundou jean chirac',NULL,NULL,NULL,NULL,'UhBsgbS'),(10,3,'Défis et obstacles à l\'entrepreneuriat au Cameroun','Accès au financement, infrastructure et bureaucratie',NULL,'Malgré son dynamisme, l\'entrepreneuriat au Cameroun fait face à plusieurs défis. L\'accès au financement, l\'insuffisance des infrastructures et la lourdeur des procédures administratives constituent des obstacles majeurs pour les entrepreneurs camerounais. Des efforts sont nécessaires pour lever ces obstacles et créer un environnement plus favorable à l\'entrepreneuriat.','2024-06-11 15:00:16',NULL,NULL,0,1,'EN_ATTENTE',NULL,'Eloundou jean chirac',NULL,NULL,NULL,NULL,'LYrNehq9'),(11,3,'Femmes entrepreneures au Cameroun : Briser les stéréotypes et réussir','Promouvoir l\'autonomisation et l\'inclusion des femmes',NULL,'Les femmes entrepreneures jouent un rôle de plus en plus important dans l\'économie camerounaise. Elles brisent les stéréotypes et réussissent dans divers domaines, contribuant ainsi à la croissance et au développement du pays. Des initiatives et des programmes spécifiques visent à soutenir et à autonomiser les femmes entrepreneures au Cameroun.','2024-06-11 15:01:10',NULL,NULL,0,1,'EN_ATTENTE',NULL,'Steve celestin',NULL,NULL,NULL,NULL,'SYmw6eiJz'),(12,3,'L\'entrepreneuriat agricole au Cameroun : Nourrir la population et créer des emplois','Moderniser l\'agriculture et assurer la sécurité alimentaire',NULL,'L\'entrepreneuriat agricole joue un rôle crucial dans la sécurité alimentaire et le développement rural au Cameroun. De jeunes entrepreneurs innovent dans le domaine agricole, en apportant des solutions pour améliorer la productivité, la transformation et la commercialisation des produits agricoles.','2024-06-11 15:02:41',NULL,NULL,0,1,'EN_ATTENTE',NULL,'Steve celestin',NULL,NULL,NULL,NULL,'07gVfGPq'),(13,3,'L\'entrepreneuriat social au Cameroun : Un impact positif sur la société et l\'environnement','Combiner business et impact social pour un développement durable',NULL,'L\'entrepreneuriat social connait un essor remarquable au Cameroun. De plus en plus d\'entrepreneurs développent des entreprises à vocation sociale et environnementale, contribuant ainsi à la résolution de problèmes sociétaux et à la promotion du développement durable.','2024-06-11 15:03:50',NULL,NULL,0,1,'EN_ATTENTE',NULL,'Eloundou jean chirac',NULL,NULL,NULL,NULL,'kXQhKRRK'),(14,2,'Six mois de Javier Milei au pouvoir : l\'Argentine dépense moins mais compte plus de pauvres','<i>Après six mois au pouvoir, le gouvernement du président argentin Javier Milei est à un moment charnière. Sa politique d\'austérité a permis un équilibre budgétaire inédit depuis 15 ans, mais la pauvreté s\'envole dans le pays, après la multiplication des coupes budgétaires et des licenciements dans le secteur public. Et le Sénat vient d’adopter une série de réformes allant dans le même sens.</i>','POLITIQUE','Surnommé le président <b>\"offshore\"</b> par ses opposants pour ses nombreux voyages à l’étranger, Javier Milei fête, jeudi 20 juin, ses six premiers mois à la présidence argentine. Loin d’être absent, le dirigeant ultralibéral a bel et bien commencé, à coups de décrets, à sabrer dans les dépenses publiques, comme il l’avait promis en brandissant une tronçonneuse lors de la campagne présidentielle.\n\nLa \"thérapie de choc\" d\'austérité prônée par Javier Milei s’est concrétisée avec de premières mesures phares depuis décembre : prix et loyers libérés, fin des subventions aux transports, à l\'énergie, gel des chantiers publics, coupes budgétaires tous azimuts…\n\nPrès de 15 000 postes de fonctionnaires ont été <a href=\"https://programmeLeadership.net\">supprimés en mars dans les ministères</a>, la Banque centrale, des organismes d’État comme la Sécurité sociale, la caisse de retraite, le service de météorologie ou encore l’Agence nationale du handicap (Andis). Avec pour conséquence \"la fermeture de tous les centres d’accueil du pays, qui empêche les personnes handicapées de réaliser plusieurs démarches afin d’obtenir diverses prestations, et du retard dans le traitement des pensions, et dans la livraison de médicaments ou de chaises roulantes\", relève le quotidien argentin Pagina 12.\n\nPrès de 9 000 autres licenciements avaient également été signifiés depuis l’arrivée au pouvoir de Javier Milei, déterminé à continuer la purge, puisqu’il a annoncé en avril qu’il comptait licencier prochainement 50 000 autres fonctionnaire.\n\n\n','2024-06-20 18:17:36','2024-06-30 18:56:04','2024-06-20 18:22:21',0,15,'PUBLIER',NULL,'Bahar MAKOOI',NULL,NULL,NULL,NULL,'DNbEyviLo'),(15,2,'Emmanuel macron dissous l\'assemble national de france','un acte tres rare et pertubateur pour l\'etat francais et ses institutions','Politique de france europe','Surnommé le président \"offshore\" par ses opposants pour ses nombreux voyages à l’étranger, Javier Milei fête, jeudi 20 juin, ses six premiers mois à la présidence argentine. Loin d’être absent, le dirigeant ultralibéral a bel et bien commencé, à coups de décrets, à sabrer dans les dépenses publiques, comme il l’avait promis en brandissant une tronçonneuse lors de la campagne présidentielle.\n\nLa \"thérapie de choc\" d\'austérité prônée par Javier Milei s’est concrétisée avec de premières mesures phares depuis décembre : prix et loyers libérés, fin des subventions aux transports, <b>à l\'énergie, gel des chantiers publics, coupes budgétaires tous azimuts…</b>\n\n<i><b>Près de 15 000 postes de fonctionnaires ont été supprimés en mars dans les ministères, la Banque centrale, des organismes d’État comme la Sécurité sociale, la caisse de retraite, le service de météorologie ou encore l’Agence nationale du handicap (Andis).</b></i> Avec pour conséquence \"la fermeture de tous les centres d’accueil du pays, qui empêche les personnes handicapées de réaliser plusieurs démarches afin d’obtenir diverses prestations, et du retard dans le traitement des pensions, et dans la livraison de médicaments ou de chaises roulantes\", relève le quotidien argentin Pagina 12.','2024-06-25 17:54:12','2024-07-02 08:32:58','2024-06-26 03:11:49',0,26,'PUBLIER',NULL,'Teta Luc steves',NULL,NULL,NULL,NULL,'sbvjp1jkd');
