INSERT INTO `bloc` VALUES (1,1,NULL,'Le business plan : Généralités','Le marketing digital est l\'ensemble des techniques marketing mises en œuvre sur internet et les appareils mobiles. Il vise à atteindre des objectifs de notoriété, de trafic.',NULL,NULL),(2,1,NULL,'Le business plan : contenu','Vous souhaitez développer votre visibilité et engager votre audience sur les réseaux sociaux ? Découvrez 5 astuces clés pour booster votre présence : 1. **Définissez vos objectifs**: Commencez par identifier vos objectifs précis (notoriété, engagement, trafic, etc.). Cela vous permettra de choisir les plateformes les plus adaptées et de créer une stratégie cohérente. 2. **Ciblez votre audience**: Identifiez votre public cible et adaptez votre contenu à ses besoins et ses intérêts. Utilisez des personas pour mieux comprendre les attentes de votre audience. 3. **Créez du contenu engageant**: Publiez du contenu de qualité, varié et attractif (images, vidéos, articles, stories) qui suscite l\'intérêt et incite à l\'interaction.',NULL,NULL),(3,1,NULL,'L’analyse stratégique',NULL,NULL,NULL),(4,1,NULL,'Les moyens d’exploitation',NULL,NULL,NULL),(5,1,NULL,'L’analyse financière',NULL,NULL,NULL),(6,2,NULL,NULL,NULL,NULL,NULL),(7,3,NULL,'L’Entreprise/Projet: Mission, Vision, But, Stratégies, Objectifs CML, ',NULL,NULL,NULL),(8,3,NULL,'Organisation stratégique et Opérationnelle de l’entreprise ',NULL,NULL,NULL),(9,3,NULL,'Contrôle, Suivi et Evaluation',NULL,NULL,NULL),(10,3,NULL,'Structuration interne de l’entreprise et Organigramme : Du conseil ',NULL,NULL,NULL),(11,3,NULL,'Elaboration et Mise à jour des jobs description',NULL,NULL,NULL),(12,3,NULL,'Tableau croisé dynamique PESTEL et SWOT des ressources utilisées',NULL,NULL,NULL),(13,4,NULL,'Elaboration dynamique et mise à jour des jobs description',NULL,NULL,NULL),(14,4,NULL,'Gestion opérationnelle du projet',NULL,NULL,NULL),(15,4,NULL,'Cycle de vie de la Ressource',NULL,NULL,NULL),(16,4,NULL,'Optimisation des ressources',NULL,NULL,NU