INSERT INTO `libelle` VALUES (1,1,'Développez votre vision','Expand your vision','Le business plan est bien plus qu’un simple document. C’est la vision concrète de votre entreprise. Apprenez à élaborer un plan solide qui guidera vos actions et vous mènera vers le succès.','The business plan is much more than just a document. This is the concrete vision of your company. Learn how to develop a solid plan that will guide your actions and lead you to success.'),(2,1,'Stratégie et Objectifs','Strategy and Objectives','Découvrez comment définir des objectifs clairs et les stratégies pour les atteindre. Le business plan est votre carte au trésor vers la rentabilité.','Find out how to set clear goals and the strategies to achieve them. The business plan is your treasure map to profitability.'),(3,2,'Les Rouages Financiers','The Financial Workings','Plongez dans les chiffres, les marges et les flux de trésorerie. Comprenez comment rendre votre entreprise rentable et durable.','Dive into the numbers, margins and cash flow. Understand how to make your business profitable and sustainable.'),(4,2,'Processus Optimisés','Optimized Processes','Explorez les meilleures pratiques opérationnelles. De la logistique à la gestion des stocks, découvrez comment optimiser chaque aspect de votre entreprise','Explore operational best practices. From logistics to inventory management, learn how to optimize every aspect of your business'),(5,3,'Rayonnez sur le Marché ','Shine on the Market','Le marketing est l’art de se faire remarquer. Explorez les tactiques modernes pour promouvoir vos produits et services. Devenez un maître du marketing digital et attirez vos clients idéaux.','Marketing is the art of getting noticed. Explore modern tactics to promote your products and services. Become a digital marketing master and attract your ideal customers.'),(6,3,'Storytelling Impactant','Impactful Storytelling','Apprenez à raconter votre histoire de manière captivante. Le marketing, c’est aussi l’art de toucher les cœurs et de créer des connexions durables','Learn to tell your story in a compelling way. Marketing is also the art of touching hearts and creating lasting connections'),(7,4,'Leadership Éclairé','Enlightened Leadership','Le management, c’est bien plus que des chiffres et des rapports. C’est l’art de guider une équipe vers l’excellence. Découvrez les compétences essentielles pour être un leader inspirant','Management is much more than numbers and reports. It is the art of guiding a team towards excellence. Discover the essential skills to be an inspiring leader'),(8,4,'Gestion du Temps et des Ressources','Time and Resource Management','Apprenez à optimiser votre temps et à allouer vos ressources efficacement. Le management, c’est la clé pour une entreprise bien huilée.','Learn how to optimize your time and allocate your resources efficiently. Management is the key to a well-oiled business.');
/*!40000 ALTER TABLE `libelle` ENABLE KEYS */;
UNLOCK TABLES;

