INSERT INTO `proposition` VALUES (1,1,'Leadership directif: Le leader donne des instructions précises et supervise étroitement le travail','Directive Leadership: The leader gives specific instructions and closely supervises the work.',1),(2,1,'Leadership participatif: Le leader consulte l\'équipe et prend des décisions en collaboration','Participative Leadership: The leader consults with the team and makes decisions collaboratively.',0),(3,1,'Leadership délégatif: Le leader donne à l\'équipe une grande liberté et une grande responsabilité','Delegative leadership: The leader gives the team great freedom and responsibility.',0),(4,1,'Leadership situationnel: Le leader adapte son style en fonction de la situation et des besoins de l\'équipe','Situational leadership: The leader adapts his style according to the situation and the needs of the team.',0),(5,2,'Manque de reconnaissance: Le travail de l\'employé n\'est jamais reconnu ou valorisé','Lack of recognition: The employee\'s work is never recognized or valued.',0),(6,2,'Absence de perspectives d\'évolution: L\'employé n\'a aucune possibilité de progresser dans sa carrière','Lack of development prospects: The employee has no possibility of progressing in his career',1),(7,2,'Mauvaises relations avec les collègues: L\'employé a des conflits ou des tensions avec ses collègues','Poor relationships with colleagues: The employee has conflicts or tensions with colleagues.',1),(8,3,'Organiser des réunions régulières: Permettre aux membres de l\'équipe de partager des informations et de discuter des problèmes','Hold regular meetings: Allow team members to share information and discuss issues',0),(9,3,'Utiliser un canal de communication unique: Centraliser les communications pour éviter la confusion et les informations dispersées','Use a single communication channel: Centralize communications to avoid confusion and scattered information',1),(10,3,'Encourager le feedback constructif: Favoriser une communication ouverte et honnête entre les membres de l\'équipe','Encourage constructive feedback: Foster open and honest communication between team members',0),(11,4,'Un leadership directif, où le leader donne des instructions précises et suit de près le travail de l\'équipe','Directive leadership, where the leader gives precise instructions and closely monitors the work of the team',0),(12,4,'Un leadership démocratique, où le leader implique l\'équipe dans la prise de décision et encourage la participation de chacun','Democratic leadership, where the leader involves the team in decision-making and encourages everyone\'s participation',0),(13,4,'Un leadership laissez-faire, où le leader donne une grande autonomie à l\'équipe et intervient peu dans le travail quotidien','Laissez-faire leadership, where the leader gives great autonomy to the team and intervenes little in daily work',1),(14,4,'Le style de leadership le plus efficace dépend de la situation et des caractéristiques de l\'équipe','The most effective leadership style depends on the situation and team characteristics',0),(15,5,'Ignorer les conflits et espérer qu\'ils se résolvent d\'eux-mêmes.','Ignore conflicts and hope they resolve themselves.',0),(16,5,' Intervenir immédiatement et imposer une solution au conflit.','Intervene immediately and impose a solution to the conflict.',0),(17,5,'Organiser une réunion avec les parties concernées pour discuter du problème et trouver une solution commune','Organize a meeting with relevant parties to discuss the problem and find a common solution',1),(18,5,'Encourager les membres de l\'équipe à communiquer ouvertement et à résoudre leurs conflits par eux-mêmes','Encourage team members to communicate openly and resolve conflicts on their own',0),(19,6,'11 regions','11 regions',0),(21,6,'10 regions','10 regions',1),(22,6,'7 regions','7 regions',0);
/*!40000 ALTER TABLE `proposition` ENABLE KEYS */;
